export type IconsType = keyof typeof typeIcons

interface IconProps extends BaseIconProps, BaseComponentProps {
  icon: keyof typeof typeIcons
}

export default function Icons(props: IconProps) {
  return <CreateIcon customIcons={typeIcons} {...props} />
}



interface createIconProps extends BaseIconProps, BaseComponentProps {
  icon: string;
  customIcons: Record<string, React.ReactNode>;
}

export const CreateIcon = ({
  icon,
  customIcons,
  ...props
}: createIconProps) => {
  const isClickable = typeof props.onClick === 'function';
  const style = {
    strokeWidth: props?.style?.strokeWidth || 1.8,
    rotate: props?.rotate ? `${props?.rotate}deg` : '',
    ...props.style,
  };


  const className = 'pointer rounded-md relative ' + `${props?.className || 'action-icon'}`;
  const viewBox = `${props?.x || 0} ${props?.y || 0} 24 24`;


  const svg = (
    <>
      {
        customIcons[icon] ? (
          <svg
            className={icon === 'loading' ? `animate-spin` : ''}
            height={props?.size || 24}
            width={props?.size || 24}
            viewBox={viewBox}
            fill="none"
            stroke="none"
            style={{
              transition: 'transform .12s ease-in-out',
              ...style
            }}
          >
            {customIcons[icon]}
          </svg >
        ) : <Icons icon='loading' {...props} />
      }
    </>
  )

  return isClickable
    ? <span className={className} onClick={props?.onClick}>{svg}</span>
    : svg;
}